import './App.css';

function App() {

  // const a = [1, 2, 3];
  // const b = [...a];

  const spread = {
    a: 1,
    b: 2,
    c: 3,
    d: 4,
  };

  const { a, b, ...rest } = spread;

  return (
    <div className="App">
      <header className="App-header">
        <p>Hello CSCI E-39!</p>
        <p>
          My name is Jessica Reed {a}
        </p>
      </header>
    </div>
  );
}

export default App;
